<script>
import * as chroma from 'chroma-js'

export default {
  name: 'GraphicMap',
  props: {
    regions: {
      type: Object,
      required: true,
    },
  },
  computed: {
    localRegions() {
      const result = {}
      let maxCount = 0

      Object.keys(this.regions).forEach((key) => {
        if (this.regions[key] > maxCount) {
          maxCount = this.regions[key]
        }
      })

      Object.keys(this.regions).forEach((key) => {
        const count = this.regions[key]
        const proportion = count / maxCount.toFixed(1)

        let color = ''

        if (!proportion) {
          color = '#EBEBEC'
        } else {
          const diff = 1 - (proportion < 0.1 ? 0.1 : proportion)
          color = chroma.mix('#001B71', '#E2E9FE', diff).hex()
        }

        result[key] = {
          count,
          color,
        }
      })

      return result
    },
  },
}
</script>

